import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './component/TodoList';

class App extends Component{
  constructor(){
    this.todoItems = [
      'Di mua bim bim',
      'Di da bong'
    ]
  }
}

export default App;
